function render()
{
    gl.clear( gl.COLOR_BUFFER_BIT | gl.DEPTH_BUFFER_BIT);

    //Eye - location of camera, at - look at point
    var model_view = lookAt(eye, vec3(0,0,0), vec3(0,1,0));
    var projection;

    //Projection
    if(perspSelect)
    {
        var projection = perspective(60, 1, 0.0001, 200);
    }
    else
    {
        var projection = ortho(-1,1,-1,1,-200,200);
    }

    gl.uniformMatrix4fv(projLoc, false, flatten(projection));
    gl.uniformMatrix4fv(modelViewLoc, false, flatten(model_view));

    //Points

    //Calculate Shading products
    ambientProduct = mult(light_ambient, materials[matIndex[2]][0]);
    diffuseProduct = mult(light_diffuse, materials[matIndex[2]][1]);
    specularProduct = mult(light_specular, materials[matIndex[2]][2]);
    gl.uniform3fv(ambientLoc, flatten(convertV4_V3(ambientProduct)));
    gl.uniform3fv(diffuseLoc, flatten(convertV4_V3(diffuseProduct)));
    gl.uniform3fv(specularLoc, flatten(convertV4_V3(specularProduct)));
    gl.uniform3fv(lightPosLoc, flatten(lightPosition));
    gl.uniform1f(shininessLoc, material_shininess);

    gl.bindBuffer(gl.ARRAY_BUFFER, music_cBuffer);
    gl.vertexAttribPointer( colorLoc, 3, gl.FLOAT, false, 0, 0 );
    gl.enableVertexAttribArray( colorLoc );
    gl.bindBuffer(gl.ARRAY_BUFFER, music_vBuffer);
    gl.vertexAttribPointer(positionLoc, 3, gl.FLOAT, false, 0, 0);
    gl.enableVertexAttribArray(positionLoc);
    gl.drawArrays(gl.TRIANGLES, 0, positions3.length);
   
    //Drexel Dragon


    //Calculate Shading products
    ambientProduct = mult(light_ambient, materials[matIndex[1]][0]);
    diffuseProduct = mult(light_diffuse, materials[matIndex[1]][1]);
    specularProduct = mult(light_specular, materials[matIndex[1]][2]);
    gl.uniform3fv(ambientLoc, flatten(convertV4_V3(ambientProduct)));
    gl.uniform3fv(diffuseLoc, flatten(convertV4_V3(diffuseProduct)));
    gl.uniform3fv(specularLoc, flatten(convertV4_V3(specularProduct)));
    gl.uniform3fv(lightPosLoc, flatten(lightPosition));
    gl.uniform1f(shininessLoc, material_shininess);

    gl.bindBuffer(gl.ARRAY_BUFFER, dragon_cBuffer);
    gl.vertexAttribPointer( colorLoc, 3, gl.FLOAT, false, 0, 0 );
    gl.enableVertexAttribArray( colorLoc );
    gl.bindBuffer(gl.ARRAY_BUFFER, dragon_vBuffer);
    gl.vertexAttribPointer(positionLoc, 3, gl.FLOAT, false, 0, 0);
    gl.enableVertexAttribArray(positionLoc);
    gl.drawArrays(gl.TRIANGLES, 0, positions2.length);

      
    //Teapot 

    //Passing shading and light position uniforms

    //Calculate Shading products
    ambientProduct = mult(light_ambient, materials[matIndex[0]][0]);
    diffuseProduct = mult(light_diffuse, materials[matIndex[0]][1]);
    specularProduct = mult(light_specular, materials[matIndex[0]][2]);
    gl.uniform3fv(ambientLoc, flatten(convertV4_V3(ambientProduct)));
    gl.uniform3fv(diffuseLoc, flatten(convertV4_V3(diffuseProduct)));
    gl.uniform3fv(specularLoc, flatten(convertV4_V3(specularProduct)));
    gl.uniform3fv(lightPosLoc, flatten(lightPosition));
    gl.uniform1f(shininessLoc, material_shininess);

                
    //Passing projection and scaling uniforms
    gl.uniformMatrix4fv(projLoc, false, flatten(projection));
    gl.uniformMatrix4fv(modelViewLoc, false, flatten(model_view));
    
    gl.bindBuffer(gl.ARRAY_BUFFER, cBuffer);
    gl.vertexAttribPointer( colorLoc, 3, gl.FLOAT, false, 0, 0 );
    gl.enableVertexAttribArray( colorLoc );
    gl.bindBuffer(gl.ARRAY_BUFFER, vBuffer);
    gl.vertexAttribPointer(positionLoc, 3, gl.FLOAT, false, 0, 0);
    gl.enableVertexAttribArray(positionLoc);

    gl.drawArrays(gl.TRIANGLES, 0, positions.length);
    

    requestAnimationFrame(render);
}


window.addEventListener("keydown", function() {
    
    switch (event.key) {
        
        case "w": // Increase camera radius
            r += 0.25;
            break;
        case "s": // Decrease camera radius
            r -= 0.25;
            if(r <= 0)
            {
                r = 0.01;
            }
            break;
        case "d": // Increase height
            h += 0.25;
            break;
        case "a": // Decrease height
            h -= 0.25;
            break;
        case "q": // Increase theta
            theta += pi / 32;
            break;
        case "e": // Decrease theta
            theta -= pi / 32;
            break;
        case "1":
            lightingIndex[0] = (lightingIndex[0] + 1) % 4;
            materials[0][2] = lightingRotary[lightingIndex[0]][0];
            materials[0][3] = lightingRotary[lightingIndex[0]][1];
            document.getElementById("mat1").innerHTML = matDescription[lightingIndex[0]];
            break;
        case "2":
            lightingIndex[1] = (lightingIndex[1] + 1) % 4;
            materials[1][2] = lightingRotary[lightingIndex[1]][0];
            materials[1][3] = lightingRotary[lightingIndex[1]][1];
            document.getElementById("mat2").innerHTML = matDescription[lightingIndex[1]];
            break;
        case "3":
            lightingIndex[2] = (lightingIndex[2] + 1) % 4;
            materials[2][2] = lightingRotary[lightingIndex[2]][0];
            materials[2][3] = lightingRotary[lightingIndex[2]][1];
            document.getElementById("mat3").innerHTML = matDescription[lightingIndex[2]];
            break;
        case "r": //Reset all
            r = 2;
            h = 0;
            theta = pi;
            matIndex = [0,1,2];
            document.getElementById("mat1").innerHTML = matDescription[matIndex[0]];
            document.getElementById("mat2").innerHTML = matDescription[matIndex[1]];
            document.getElementById("mat3").innerHTML = matDescription[matIndex[2]];
            materials[0][1] = vec4(1.0, 0.1, 0.1, 1.0);
            materials[1][1] = vec4(0.05,0.5,1.0,1.0);
            materials[2][1] = vec4(0.45,0.7,0.05,1.0);
            materials[3][1] = vec4(0.13,0.6,0.72,1.0);
            break;
        default:
            break;

    }

    //Camera orbit calculations

    var eyeX = r * Math.cos(theta);
    var eyeY = h;
    var eyeZ = r * Math.sin(theta);
    eye = vec3(eyeX, eyeY, eyeZ);

    gl.bindFramebuffer(gl.FRAMEBUFFER, framebuffer);
    gl.clear( gl.DEPTH_BUFFER_BIT | gl.COLOR_BUFFER_BIT);
    //return to default frame buffer
    gl.bindFramebuffer(gl.FRAMEBUFFER, null);

    

});

function convertV4_V3(vec4Input)
{
    return vec3(vec4Input[0],vec4Input[1],vec4Input[2]);
}


function convertV3_V4(vec3Input,num)
{
    return vec4(vec3Input[0],vec3Input[1],vec3Input[2],num);
}



